    var jsonData = JSON.parse(responseBody);
    tests["auth_token"] = jsonData.auth_token !== "";
    postman.clearEnvironmentVariable("global_auth_token");
    postman.setEnvironmentVariable("global_auth_token", jsonData.auth_token);
    postman.clearEnvironmentVariable("global_token");
    tests["token"] = jsonData.token !== "";
    postman.setEnvironmentVariable("global_token", jsonData.token);

}

